import React, { Component } from 'react';
import './App.css';
import SideBar from './componentes/SideBar';
import simple from './averysimplecomponent'
import {BrowserRouter, Route, Switch} from 'react-router-dom'

function intento () {
  return (
    <p>
      holiwis
    </p>
  )
}

function SideBar1() {
  return <SideBar/>;
}

function About() {
  return <h2>About</h2>;
}

function Users() {
  return <h2>Users</h2>;
}

function AppRouter() {
  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/about/">About</Link>
            </li>
            <li>
              <Link to="/users/">Users</Link>
            </li>
          </ul>
        </nav>

        <Route path="/" exact component={SideBar} />
        <Route path="/about/" component={About} />
        <Route path="/users/" component={Users} />
      </div>
    </Router>
  );
}


class App extends Component {
  render() {
    return (
      <BrowserRouter>
        <Switch>
          <Route path="/" Component={intento}/>
        </Switch>
      </BrowserRouter>
    );
  }
}

export default App;
